const SugarDetails = ({ sugar }) => {
  return (
    <div className="workout-details">
      <h4>Sugar Level : {sugar.sugarlvl}</h4>
      <h4>Time : {sugar.time}</h4>
      <p>Meal : {sugar.meal}</p>

      <p>Notes : {sugar.notes}</p>
    </div>
  );
};
export default SugarDetails;
